module.exports = {
  initMap() {
    const google = window.google;
    this.mapOptions = {
      center: {
        lat: 39.14,
        lng: -98.1,
      },
      zoom: 4,
      clickableIcons: false,
      streetViewControl: false,
      zoomControl: true,
      fullscreenControl: false,
      mapTypeControl: false
    }

    // Set the map
    window.atlasInstance = new google.maps.Map(document.getElementById('atlas-map'), this.mapOptions);
  }
}
